import {gql} from 'apollo-boost'

const getCarsQuery = gql`
{
	cars {
		name
		year
	}
}`

const getBrandsQuery = gql`
{
	brands {
		name
		country
}
}`

export { getBrandsQuery, getCarsQuery}
